    - '2015-11-14 03:29:37.865236'
    - '2015-11-25 09:35:20.545132'
    - "\r\n\r\n保守的な家父長制を容認する\r\n\r\n\r\n\r\n\r\n国家への依存体質を克服すべきと考える。福祉給付は見直すべき。\r\n低俗な欲望を道徳化することに関心をもつ\r\n\r\n\r\n\r\n\r\n経済が全体として成長することを志向している。\r\n"
    - "低俗な欲望を道徳化することに関心をもつ"
    - "経済が全体として成長することを志向している。"
    - "保守的な家父長制を容認する"
    - "国家への依存体質を克服すべきと考える。福祉給付は見直すべき。"
  - - 2
    - "ネオリベ"
    - 1
    - -1
    - 1
    - -1
    - '2015-11-18 00:57:45.156251'
    - '2015-11-25 09:35:56.598582'
    - "家父長制の営みも自由に認める。\r\n\r\n\r\n\r\n\r\n国家が社会の倫理化を企てるべきでない。\r\n企業の利益追求の自由を認める。\r\n\r\n\r\n\r\n\r\n経済秩序全体の成長を志向する。\r\n\r\n\r\n\r\n\r\n"
    - "企業の利益追求の自由を認める。"
    - "経済秩序全体の成長を志向する。"
    - "家父長制の営みも自由に認める。\r\n"
    - "国家が社会の倫理化を企てるべきでない。"
  - - 3
    - "アナキズム"
    - -1
    - 1
    - 1
    - -1
    - '2015-11-18 00:59:15.243494'
    - '2015-11-25 09:36:30.573689'
    - "共同体のアソシエーション活動の称揚。\r\n\r\n\r\n\r\n\r\n国家権力の否定。\r\n各個人の理性的判断の称揚。\r\n\r\n\r\n\r\n\r\n共同体的価値を保持することが大事。\r\n\r\n\r\n\r\n\r\n"
    - "各個人の理性的判断の称揚。"
    - "共同体的価値を保持することが大事。"
    - "共同体のアソシエーション活動の称揚。"
    - "国家権力の否定。"
  - - 4
    - "リバタリアニズム"
    - 1
    - 1
    - 1
    - -1
    - '2015-11-18 00:59:42.495492'
    - '2015-11-25 09:37:00.472021'
    - "企業の利益追求を認める。\r\n\r\n\r\n\r\n\r\n経済が衰退するとしても、原理的な公正を優先すべき。\r\n\r\n\r\n\r\n\r\n自由な関係性を認める。\r\n\r\n\r\n\r\n\r\n政府からの干渉を最低限にする。"
    - "企業の利益追求を認める。"
    - "経済が衰退するとしても、原理的な公正を優先すべき。"
    - "自由な関係性を認める。"
    - "政府からの干渉を最低限にする。"
  - - 5
    - "マルクス主義"
    - 1
    - 1
    - -1
    - 1
    - '2015-11-18 01:03:03.426841'
    - '2015-11-25 09:37:29.593371'
    - "家父長制は近代資本主義の遺物とみなし、男女平等を実現しようとする。\r\n\r\n\r\n\r\n\r\n革命を導くための理想として国家レベルでの連帯と共感を展望する。\r\n国家が経済制度を革新していくべき。\r\n\r\n\r\n\r\n\r\n既存秩序の革命的転覆を志向する。\r\n\r\n\r\n\r\n\r\n"
    - "国家が経済制度を革新していくべき。"
    - "既存秩序の革命的転覆を志向する。"
    - "家父長制は近代資本主義の遺物とみなし、男女平等を実現しようとする。"
    - "革命を導くための理想として国家レベルでの連帯と共感を展望する。"
  - - 6
    - "市民コミュニタリアニズム"
    - -1
    - 1
    - -1
    - 1
    - '2015-11-18 01:03:36.322752'
    - '2015-11-25 09:38:00.881557'
    - "組織内部で生じた問題について、組織内部での自浄努力や自律的な解決を期待せず、市民的な法の観点から、法によって制裁することが望ましい。\r\n\r\n\r\n\r\n\r\n国家による地域共同体の促進を求める。\r\n経済的活動はさまざまな倫理的紐帯に埋め込まれているべき。\r\n\r\n\r\n\r\n\r\n社会全体の秩序は問題にしない。共同体的価値を保持することが大事。\r\n\r\n\r\n\r\n\r\n"
    - "経済的活動はさまざまな倫理的紐帯に埋め込まれているべき。"
