    - "自然あるがままの世界を好み、それを脅かすものがいれば、自らを正義として制裁を与えようとする。一般的に戦や自然を司る神が多く属し、またそれゆえに自分に厳しい性格である者も多い。当然ながら人間に対する態度も非常に厳しい。"
