    - -1
    - "自らの欲望に忠実であり、時には破壊や殺戮といった行為も自然な行動として実行する。あるがままな混沌的状況を好む性格。破壊の衝動だけでなく、怒りや妬みといった負のエネルギーを感知、吸収し行動する。世界に混乱と秩序からの解放を招こうと画策する魔王をはじめ、ありとあらゆるものを破壊する邪龍が象徴的存在である。"
